import RequestReset from '../components/RequestReset';

const ResetPage = ({ query }) => {
  console.log(query);
  if (!query?.token) {
    return (
      <>
        <p>Sorry you must supply a token!</p>
        <RequestReset />
      </>
    );
  }
  return <div>Reset {query.token}</div>;
};

export default ResetPage;
